	  <script>
	  function beforelogin()
	  {
		 if( $('#txtusername').val().length === 0  ||  $('#txtpass').val().length === 0 ) {
			 return false;
		 }
		 
	  if($('#remme').is(':checked'))
	  {
		  localStorage.setItem('twiscryptologin',$('#txtusername').val());
		  localStorage.setItem('twiscryptopass', $('#txtpass').val());
	  }		
else
{
	localStorage.setItem('twiscryptologin','');
	localStorage.setItem('twiscryptopass','');
}	
	  }
	  $(document).ready(function()
	  {
		   $('#txtusername').focus();
		   
		   $('#txtusername').val(localStorage.getItem("twiscryptologin"))
		   $('#txtpass').val(localStorage.getItem("twiscryptopass"))
		   
